  body {
    font-family: 'Inter', sans-serif;
    font-size: 12px;
    line-height: 1.4;
    color: #000;
  }

  .lf  { text-align: left; }
  .cn  { text-align: center; }
  .rt  { text-align: right; }
  .sm  { font-size: small; }
  .lg  { font-size: large; }
  .b   { font-weight: bold; }

  .custom-heading {
    font-size: 20px;
    font-weight: bold;
    text-align: center;
    margin-top: -15px;
    margin-bottom: 20px;
    text-transform: uppercase;
    color: #000;
  }

