    padding: 0px 2px;
    vertical-align: top;
    border: 1px solid #ccc;
    line-height: 0.3;
    color: #000;
  }

  .trip-table td strong {
    font-weight: normal;
  }

  .items-table {
    border-collapse: collapse;
    width: 100%;
  }

  .items-table thead {
    display: table-header-group;
  }

  .items-table th {
    font-weight: bold;
    font-size: 13px;
    color: #000;
    vertical-align: top;
    border: 1px solid #000 !important;
  }

  .items-table td {
    color: #000;
    vertical-align: top;
    border: 1px solid #000 !important;
  }

  .summary-table {
    border-collapse: collapse;
    width: 100%;
  }

  .summary-table thead {
    display: table-header-group;
  }

